import React from 'react';
import '../index.css';

function Footer() {
  return (
    <footer>
      <p>Contact Information:</p>
      <p>Email: alexander.lehnbom@gmail.com</p>
      <p>Phone: +123 456 7890</p>
    </footer>
  );
}

export default Footer;
